import styled from 'styled-components';

export const Checkouth1 = styled.h1`
font-weight: 900;
font-size: 28px;
color: #000;
margin: 20px 0;
`;

export const CheckoutList = styled.div`
display:flex;
flex-direction: column;
justify-content:flex-start;
align-items:center;
`;
